import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import TechnicalProcesses from './components/TechnicalProcesses';
import HomePage from './pages/HomePage';
import ServicesPage from './pages/ServicesPage';
import AboutPage from './pages/AboutPage';
import ContactPage from './pages/ContactPage';
import './styles/index.css';

function App() {
  return (
    <Router>
      <div className="app">
        <Navbar />
        <main className="main-content">
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/services" element={<ServicesPage />} />
            <Route path="/about" element={<AboutPage />} />
            <Route path="/contact" element={<ContactPage />} />
            {/* Process Unit Pages */}
            <Route path="/distillation" element={require('../pages/DistillationPage').default ? React.createElement(require('../pages/DistillationPage').default) : null} />
            <Route path="/extraction" element={require('../pages/ExtractionPage').default ? React.createElement(require('../pages/ExtractionPage').default) : null} />
            <Route path="/reaction" element={require('../pages/ReactionPage').default ? React.createElement(require('../pages/ReactionPage').default) : null} />
            {/* Data Analysis Pages */}
            <Route path="/rating-curves" element={require('../pages/RatingCurvesPage').default ? React.createElement(require('../pages/RatingCurvesPage').default) : null} />
            <Route path="/qmra" element={require('../pages/QMRAAnalysisPage').default ? React.createElement(require('../pages/QMRAAnalysisPage').default) : null} />
            <Route path="/mechanistic-analysis" element={require('../pages/MechanisticAnalysisPage').default ? React.createElement(require('../pages/MechanisticAnalysisPage').default) : null} />
            <Route path="/machine-learning" element={require('../pages/MachineLearningPage').default ? React.createElement(require('../pages/MachineLearningPage').default) : null} />
          </Routes>
        </main>
        <TechnicalProcesses />
        <Footer />
      </div>
    </Router>
  );
}

export default App;
